    false,nt"url": null,nt"notes": "This data set contains lidar point data
    (UTM, Zone 11) from a strip of Southern California coastline (including water, beach,
    cliffs, and top of cliffs) from Long Beach to the US/Mexico border. The data set
    was created by combining data collected using an Optech Inc. Airborne Laser Terrain
    Mapper (ALTM) 1225 in combination with geodetic quality Global Positioning System
    (GPS) airborne and ground-based receivers. The Bureau of Economic Geology, the University
    of Texas at Austin owns and operates an ALTM 1225 system (serial number 99d118).
    The system was installed in a twin engine Partenavia P-68 Observer (tail number
    N6602L) owned and operated by Aspen Helicopter, Inc. The lidar data set described
    by this document was collected on 18 and 19 October 2005; Julian Days 29105 and
    29205 (see Lineage, Source_Information, Source_Contribution for pass information).
    99d118 instrument settings for these flights were; laser pulse rate: 25kHz, scanner
    rate: 26Hz, scan angle: +/- 20deg, beam divergence: narrow, altitude: 300-600m AGL,
    and ground speed: 95-120kts. Four GPS base stations, Seal Beach and San Onofre on
    29105 and Point Loma and Scripps Pier on 29205 (see Lineage, Source_Information,
    Source_Contribution for coordinates), operated during the survey. Data represented
    is all points including terrain, vegetation, and structures. This data also contains
    returns from the water surface. No processing has been done to remove returns from
    terrain, vegetation, structures or water surfaces.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
